import {useSpring, animated} from 'react-spring';

const SideBar = ({ open }) => {
  open=true;
  
  const props = useSpring({ x: 100, from: { x: 0 } })
  return (
    <div className='bg-white'>
    <animated.svg strokeDashoffset={props.x}>
      <path d="..." />
    </animated.svg></div>
  )
  }
export default SideBar;
